INSERT INTO `movies` VALUES (1,'Christmas Ransom','2022-12-01',1,'','When a pair of bumbling crooks hijack the Harrington and Sons toy store, a pair of kids stumble into the heist and are forced to team up with a female security officer to save Christmas.'),(2,'Troll','2022-12-01',1,'','Deep inside the mountain of Dovre, something gigantic awakens after being trapped for a thousand years. Destroying everything in its path, the creature is fast approaching the capital of Norway. But how do you stop something you thought only existed in Norwegian folklore?'),(3,'My Name Is Vendetta','2022-11-30',1,'','After old enemies kill his family, a former mafia enforcer and his feisty daughter flee to Milan, where they hide out while plotting their revenge.'),(4,'Faith Heist: A Christmas Caper','2022-11-26',1,'','On Christmas Eve, Pastor Benjamin and his motley crew of congregants find themselves locked in the local mall just as a fearsome team of armed thieves breaks in to rob the place.'),(5,'R.I.P.D. 2: Rise of the Damned','2022-11-15',1,'','When Sheriff Roy Pulsipher finds himself in the afterlife, he joins a special police force and returns to Earth to save humanity from the undead.'),(6,'Paradise City','2022-11-11',1,'','Renegade bounty hunter Ryan Swan must carve his way through the Hawaiian crime world to wreak vengeance on the kingpin who murdered his father.'),(7,'Lost Bullet 2','2022-11-10',1,'','Having cleared his name, genius mechanic Lino has only one goal in mind: getting revenge on the corrupt cops who killed his brother and his mentor.'),(8,'Black Panther: Wakanda Forever','2022-11-09',1,'','Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death. As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.'),(9,'Overdose','2022-11-04',1,'','Captain Sara Bellaiche, from Toulouse Judiciary Police branch, is investigating a go-fast linked to the murder of two teenagers, an investigation led by Richard Cross, from the Paris Criminal Brigade. Forced to collaborate in order to find the murderer and stop the bloody go-fast, Sara and Richard are both thrown in a breathless race against the clock on the roads of Spain and France.'),(10,'Shadow Master','2022-11-03',1,'','After being slain by a group of criminals, a man is reborn with animal-like superpowers and makes it his mission to right the wrongs of his city.'),(11,'Hex','2022-11-01',1,'','Following a mysterious disappearance on a jump, a group of skydivers experience paranormal occurrences that leave them fighting for their lives.'),(12,'The Takeover','2022-11-01',1,'','Self-proclaimed ethical hacker Mel Bandison’s life is turned upside down when she stops a data breach on a high-tech self-driving bus that also happens to shut down an international criminal network. She then becomes a target and is framed with a deepfake video that “shows” that she murders someone.'),(13,'The Lair','2022-10-28',1,'','Royal Air Force pilot Lt. Kate Sinclair is on her final flight mission when her jet is shot down over one of the most dangerous rebel strongholds in Afghanistan. She finds refuge in an abandoned underground bunker where deadly man-made creatures known as Ravagers — half-human, half-alien, and hungry for human flesh — are awakened.'),(14,'The System','2022-10-28',1,'','When a young soldier, newly returned from war, gets caught up in a drug bust, he is recruited by the authorities to go undercover in a notoriously dangerous prison in order to figure out what is really going on.'),(15,'Robbing Mussolini','2022-10-26',1,'','At the end of WWII, an ambitious bootlegger and his nightclub-singing girlfriend assemble a ragtag bunch of misfits for an impossible heist: to steal Mussolini’s treasure right from his headquarters.'),(16,'Blade of the 47 Ronin','2022-10-25',1,'','In this sequel to “47 Ronin,” a new class of warriors emerges among the Samurai clans to keep a sought-after sword from falling into the wrong hands.'),(17,'Detective Knight: Rogue','2022-10-21',1,'','As Los Angeles prepares for Halloween, mask-wearing armed robbers critically wound detective James Knight’s partner in a shootout following a heist. With Knight in hot pursuit, the bandits flee L.A. for New York, where the detective’s dark past collides with his present case and threatens to tear his world apart…unless redemption can claim Knight first.'),(18,'Hounded','2022-10-21',1,'','A stately home robbery takes an evil turn one night when a gang of young thieves are caught by the owners of the house and then hunted across the estate for the proprietor’s entertainment.'),(19,'Black Adam','2022-10-19',1,'','Nearly 5,000 years after he was bestowed with the almighty powers of the Egyptian gods—and imprisoned just as quickly—Black Adam is freed from his earthly tomb, ready to unleash his unique form of justice on the modern world.'),(20,'The School for Good and Evil','2022-10-19',1,'','Best friends Sophie and Agatha navigate an enchanted school for young heroes and villains — and find themselves on opposing sides of the battle between good and evil.'),(21,'Batman and Superman: Battle of the Super Sons','2022-10-17',1,'','After discovering he has powers, 11-year-old Jonathan Kent and assassin-turned-Boy-Wonder Damian Wayne must join forces to rescue their fathers (Superman & Batman) and save the planet from the malevolent alien force known as Starro.'),(22,'Accident Man: Hitman’s Holiday','2022-10-14',1,'','The Accident Man is back, and this time he must best the top assassins in the world to protect the ungrateful son of a mafia boss, save the life of his only friend and rekindle his relationship with his maniacal father figure.'),(23,'One More Shot','2022-10-13',1,'','After his wife’s death professional bodyguard Lung Wei went overseas to find doctors for his daughter, but instead found a new job as a virtual reality tester.'),(24,'Blackout','2022-10-12',1,'','A man wakes in a hospital with no memory, and quickly finds himself on the run in a locked down hospital with the Cartel on his tail.'),(25,'Guardians of Time','2022-10-11',1,'','One day, in the family manor, four cousins discover a passage to a mysterious world. Trapped in this unearthed land, the Kingdom of Keoherus, they must confront the Guardian of Time and face dark forces and beast to hopefully get home.'),(26,'Mortal Kombat Legends: Snow Blind','2022-10-09',1,'','Hellbent on taking over Earthrealm, Kano viciously attacks town after town with the aid of three cold-blooded Black Dragon mercenaries. Those who don’t submit are annihilated but one young man won’t bend the knee to Kano: Kenshi.'),(27,'Operation Seawolf','2022-10-07',1,'','During the last days of World War II, Germany, desperate for any last grasp to defeat the allied powers, looked to their last remaining weapons and soldiers. The German Navy and the last remaining U-Boats were formed together for one desperate last mission – a mission to attack the United States Homeland, known as Operation Seawolf. Captain Hans Kessler, a grizzled submarine commander from both World Wars, is called into service to make one mission a success and help turn the tide of the war.'),(28,'The OctoGames','2022-10-07',1,'','8 contestants compete in 8 deadly, classic children’s games. They seek fame beyond their wildest dreams, competing for the chance to take over the YouTube channel of the famous yet elusive masked YouTuber known only as “JaxPro”.'),(29,'Sanctioning Evil','2022-10-07',1,'','After being dishonorably discharged from the military, a Staff Sergeant finds his way back into society through a charismatic politician with a covert military operation to eliminate an underground criminal entity on U.S soil.'),(30,'All Quiet on the Western Front','2022-10-07',1,'','Paul Baumer and his friends Albert and Muller, egged on by romantic dreams of heroism, voluntarily enlist in the German army. Full of excitement and patriotic fervour, the boys enthusiastically march into a war they believe in. But once on the Western Front, they discover the soul-destroying horror of World War I.');
/*!40000 ALTER TABLE `movies` ENABLE KEYS */;
